import axios from 'axios';
import React, { Component } from 'react';
import { Table, Col, Row, Tab, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'


class UsuariosList extends React.Component {
    state = {
        usuarios: []
    }

    componentDidMount() {
        axios.get('http://localhost:8080/getUsuarios')
            .then(res => {
                console.log(res);
                this.setState({ usuarios: res.data })
            })
    }

    render() {
        return (
            <table class="table" style={{marginTop:15, marginLeft:15}}>
                <tr>
                    <th>Nombre</th>
                    <th>Apellidos</th>
                    <th>Dni</th>
                    <th>Centro de Vacunacion</th>
                    <th>Rol</th>
                    <th>Acciones</th>
                </tr>
                {this.state.usuarios.map(usuario =>
                        <tr>
                            <td>{usuario.nombre}</td>
                            <td>{usuario.apellido}</td>
                            <td>{usuario.dni}</td>
                            <td>{usuario.centroSalud}</td>
                            <td>{usuario.rol}</td>
                            <td>
                                <button class="btn btn-primary" style={{marginRight:10}}>Modificar usuario</button>
                                <button class="btn btn-danger">Eliminar usuario</button>
                            </td>
                        </tr>
                )}
            </table>
        );
    }
}

export default UsuariosList
